import React, { Component } from "react";
import {get_costumes} from "./get_costumes";

export default class Autocomplete extends Component{

    constructor(props){
        super(props);
        this.state = {
            data:[],
            costumeData: '',
        };
       
    }

    render(){
        let response = get_costumes(this.state, this.data);
        return(
            console.log(response),
            <h1>Bla</h1>
        );
    }
}
